import LoggedinContainer from "../containers/Loggedincontainers";

const Searchpage = () => {
    return (
        <LoggedinContainer currentactivescreen="search">
            <div className="text-white">
                Hii
            </div>
        </LoggedinContainer>
    );
}

export default Searchpage;
